import React from 'react';
import { SLoadMoreBtn, SLoadMoreBtnContainer } 
from '../styles/SLoadMoreBtn';

const NotFound = () => (
    <>
<h1> No movie found, try again!</h1>
 <SLoadMoreBtnContainer>

 <SLoadMoreBtn type="button" onClick={window.history.go(-1)}>Return to homepage</SLoadMoreBtn>
 </SLoadMoreBtnContainer>
 </>
)

export default NotFound;
